import React from 'react';

export default function HomePage() {
  return (
    <div className="text-center">
      <h1 className="text-4xl font-bold mb-4">Job Dashboard</h1>
      <p className="text-lg">Добро пожаловать! Выберите раздел в меню сверху.</p>
    </div>
  );
}
